import React from 'react';
import ReactDOM from 'react-dom';
import App from '../frontend/src/App.js'

const MainContent = () => {
  ReactDOM.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>,
    document.getElementById('root')
  );
};

export default MainContent;
